description:
Photogrammetry scan from the Metropolitan Museum of Art's collection, thanks to the Open Access initiative.

Terracotta krater with lid surmounted by a small hydria ca. 750–740 B.C.;
Attributed to the Cesnola Painter;
Geometric Period;
Greek, Euboean;
51 1/2 in. (130.8 cm);
The Cesnola Collection, Purchased by subscription, 1874–76;
Said to be from Kourion, Cyprus

For more information, go to the Met's site linked below:

https://www.metmuseum.org/art/collection/search/240553
